    "mode": 1,
    "identifiedError": true,
    "identifiedConclusion": false,
    "reviewContent": "“We use an Excel spreadsheet to increase or decrease the age offset until the bone-growth curves visually align to one another.” So, you are taking data and making it fit into a curve that you deem acceptable based off of a visual analysis of said curve. That seems inappropriate. What if your offset is off? It’s only determined based on a visual representation of data after all. What if it’s actually just linear growth that doesn’t match a growth spurt curve that you deemed acceptable? I think you need to come up with a better way to get your data, and you need more. ",
