    "reviewContent": "The data in the the adjustable chart seems to be incomplete. Femurs 4,5, and six appear to not have any growth before the ages of ten, while 1,2, and 3 do not appear to have grown at all after the ages of ten. I don't think an accurate data set can be completed until they have femurs that show this entire growth pattern from birth to death. We don't actually see a rapid rise in growth after the ages of ten because those femurs that do show bone growth after those ages do not show any growth before that age. This was either an oversight by the team who designed the data chart or the data is not accurate. ",
