    "id": 66,
    "mode": 1,
    "identifiedError": true,
    "identifiedConclusion": false,
    "reviewContent": "This is a fascinating study, in which the researchers placed an acceptable quality of work.  However, I am not comfortable with their manipulation of numbers via the age offset.  in particular the statement \"We use an Excel spreadsheet to increase or decrease the age offset until the bone-growth curves visually align to one another.\" leads me to think that while their intentions were to best determine the growth of the allosaurus, the data may have been inadvertently manipulated in a way to make the graphs conform with their expectations. I would like to see follow up of this study, in particular the reasons certain values were chosen for age offset data.",
