    "reviewContent": "This was a very well written article. However, they state a hypothesis is that the continual growth of dinosaurs is what caused dinosaurs to get to be too large to be supported by their environment. However, it would appear that the data suggests two growth spurts and then an leveling out of growth rate. This would seem to negate the idea that continual growth during life caused animals that are too large for their environment.",
