    "id": 194,
    "mode": 1,
    "identifiedError": true,
    "identifiedConclusion": true,
    "reviewContent": "While the technical data is interesting and probably has a lot of merit, I think the conclusion is a bit odd and I would bet against it. You could do this with humans and probably reach the same conclusion. The problem lies in taking very incomplete data sets and then transposing them on top of each other in an arbitrary manner. In my opinion, the only femur with enough of a track record to make any assumption is femur 1, which shows a normal growth curve. You only get the second \"hump\" when you combine two different femurs at different estimated points in the lives. Additionally, by manipulating the age offset assumption, you can also construct normal looking growth curves, which is probably the closer to the truth. ",
