    "reviewContent": "I don't see any paragraphs showing the limitations of the study or methodology or possible alternate conclusions or the need for further studies and what those possible future studies might entail or look for that this study missed out on or possibly got wrong. Studying only the circumference of bones might be a limiting methodology for example. Also, 6 femurs bones, from 2 regions, to me seems like a small sample size to study, considering the statement that the Allosaurus was a common dinosaur. The study appears to rush to a conclusion that the Allosaurus in general had multiple major growth spurts so easily. ",
