    "id": 163,
    "mode": 0,
    "identifiedError": false,
    "identifiedConclusion": false,
    "reviewContent": "Cool.  I really can't comment on the methods used, but it seems thoughtful and thorough.  This is the last of the 3 papers I'm reading and I think it's the best.  I wondered about age and you account for and discuss it.  I wondered if your methods are accurate.  I can't confirm, but it seems your on the right path.  Again, I like your thoughtful and thoroughness.  I wouldn't mind seeing someone else's study, independent of yours, to compare.  If you've just laid out a made-up analysis, it seems convincing to me!  I would wonder about climate, though.  Could that be another factor?  Is it possible to compare your growth analysis methods with large animals that we chart today...like following the lives of specific elephants, have a lab analyse their bones after death and compare them with the records of their known growth when they were alive.  Then, I'd be even more confident regarding the method of determining growth/age.  Back to climate.  What was it doing at the time?  That would be hard to determine.  Also, the conclusion seems different than the study.  I thought you were going to discuss actual growth spurts, not compare modern day animal size.  Is that why you mention that you cannot directly reject or support the hypothesis.  Maybe I missed the unlimited growth thing in the beginning, but will make this as acceptable because you're not jumping to conclusions.",
