    "reviewContent": "I think that this is a very interesting study. Yet, there maybe some issues with the data because of the estimation of age. It is an assumption that one LAG represents one year of growth. If this assumption is wrong, then the size of the bone at different ages is being miscalculated. Also, it was stated that LAGS may not be visible in a young Allosaurus. Thus, the data that is presented is only an estimate of growth patterns.",
