    "reviewContent": "This paper appears to be well written, grammatically correct, and written in language that the average layperson reader can understand. Methodology is explained clearly, with examples given for why a certain method was chosen. The process is well described, including allusions to similar measuring/ages of tree rings, which helps to conceptualize the study. My only notes of concern would be (1) that the process of age off-setting in an Excel spreadsheet becomes complicated in the middle of the paper; descriptions of this process and why it is necessary are far less clear than descriptions at the beginning; (2) that this appears to be a rather small sample size (6 bones) to make a firm conclusion. Otherwise, it appears to be well written and ably reasoned.",
