    "id": 175,
    "mode": 0,
    "identifiedError": true,
    "identifiedConclusion": false,
    "reviewContent": "This paper seems to be based on the tenuous assumption that \"lines of arrested growth\" represent dinosaur age in years. Could something else have caused these lines, like weather changes that replaced the organic matter with rock during the the fossilization process? (The paper also does not make it clear that these must be fossils, not actual bones.) Since even according to the authors' hypothesis, earlier growth rings disappear with aging, there's no basis for saying how old the dinosaur was even if these lines do represent age. This is illustrated in the graphic where the supposed older dinosaurs do not have younger age rings. Since allosaurus was so common there must be many more fossils available to examine -- six is too few to draw any conclusions. The authors say they selected these six -- on what basis? Implication is the selection was because they supported the theory. The age offset process is unclear and seems hokey. Based on the graphic Femur 1 does not support the hypothesis but contradicts it and the data from the last three femurs. Which femurs were from which of the two sites and does location account for observed differences? It's not clear why periodic growth spurts would result in significant size differences -- humans have more than one growth spurt but we're not as big as dinosaurs.",
