    "reviewContent": "I first look at this and see only 6 samples. That's extremely small, and nowhere near enough to conclude what they found was representative of all of the species. Their theorizing that a second growth may be why dinosaurs were larger than modern birds and reptiles seems suspicious post hoc reasoning. There are many other reasons for dinosaurs to be larger that are more plausible. In order to support this idea, I would want to see evidence that other species show this sort of growth spurt. Then again, I look at humans and see the pubertal growth spurt. This is not why we are taller than chimps, our closest relatives. This is instead due to our fully bipedal nature. Additionally, I don't know how much you can conclude about overall size based only on circumference of the femur.",
