    "identifiedError": true,
    "identifiedConclusion": false,
    "reviewContent": "Essentially the authors have developed a way to determine the size and age of the allosauras.  They do this by looking at the circumference of the femur bone, specifically something called \"lines of accelerated growth\" or LAG for short.  The authors compare it to counting the rings on a tree.  However, their methods require assuming quite a bit.  For example, LAGS may not be visible at certain times of youth.  They do have a method to account for this, but it is poorly explained and it draws a wildly unlikely conclusion: that the LAGs show the allosauras is the only animal to show several growth spurts throughout their lives.  The authors should closely reexamine their methodology as it is so incredibly unbelievable to think that they found the only animal which doesn't follow the rules of growth that are essentially golden in the animal world.",
