    "id": 80,
    "mode": 1,
    "identifiedError": false,
    "identifiedConclusion": false,
    "reviewContent": "It appears that much thought went into measuring the bone growth of the femur of the Allosaurus. I found it particularly interesting that this particular animal had two growth spurts both as a youth and an older animal. The statistics seem to bear out the findings and as such I would consider that legitimate. Comparing the markings on a centuries old femur to the rings on a tree brings the findings into a perspective that people not studying dinosaurs can understand. Taking seasons into consideration and growth during summer rather than winter is reaching, but I know from experience that human children grow much more in the summer having raised five sons and witnessed that progression first hand. I think the report is sound. ",
