    "id": 84,
    "mode": 0,
    "identifiedError": true,
    "identifiedConclusion": false,
    "reviewContent": "The biggest obstacle to accepting the authors' conclusion that Allosaurus had two major periods of bone growth in a lifetime is that each of the individual femurs shows ONE growth period. According to the authors's argument, the observed growth period in Femurs 4, 5 and 6 is the second one in the individual's life and the first one is invisible due to fading over age.  The supposition that early LAGS fade with age needs to be bolstered by examination of modern bones from animals whose life history of growth is known.  Without this, or some other validation of the method of creating \"age offsets\" (or estimated age of death), the current data analyses assume the conclusion rather than providing new evidence.",
