    "reviewContent": "By using the circumference of the bones alone while determining age could have caused some errors within the result. Looking at the data again, it looks like the bones with the larger circumference came from dinosaurs from one location while the bones with the smaller circumferences came from another. It would be better to include data about LAGs when determining the age of the dinosaurs as to rule out deficiencies within the diet which might have lead to lack of bone development and smaller bone circumferences.",
