    "identifiedError": false,
    "identifiedConclusion": false,
    "reviewContent": "Using data gathered from the bones of dinosaurs, the paper draws some conclusions regarding why dinosaurs were so big. Species such as the Allosaurus likely had multiple grow spurts through out their lives resulting in their giant size compared to their modern ancestors. The scientists support this idea by measuring the circumference of the femur, there can be multiple circumference-age measurements from a single bone. Circumference is used to predict body mass and these measurements can provide an accurate idea of the Allosaurus growth pattern.",
