    "id": 106,
    "mode": 1,
    "identifiedError": true,
    "identifiedConclusion": true,
    "reviewContent": "While the general procedure undertaken by the authors seems to be sound, there may be a flaw in how they obtained the age offsets. It appears the authors adjusted the offset until the data fit what they believed to be correct, in this case until the bone curves aligned with each other. If the age offset is incorrect, then the growth spurts occurred in different periods than what the authors claim, which could result in the data fitting the conclusion of other dinosaurs that there is no second growth spurt. Seeing how half the bones have a large age adjustment of 10 or greater, this would further undermine the data and the conclusion. ",
